import { StyleSheet, Text, View, TouchableOpacity } from "react-native";
import React from "react";
import Background from "../Component/Background";

const YouPage = () => {
  return (
    <View>
      <Background />
      <View style={styles.container}>
        <TouchableOpacity style={styles.uploadBtnContainer}>
          <Text>Upload Profile Image</Text>
        </TouchableOpacity>
        <Text>Skip</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "centre",
    alignItems: "centre",
  },
  uploadBtnContainer: {
    height: 125,
    width: 125,
    borderRadius: 125 / 2,
    justifyContent: "center",
    alignItems: "center",
    borderStyle: "dashed",
    borderWidth: 1,
  },
  uploadBtnText: {
    textAlign: "center",
    fontSize: 16,
    opacity: 0.3,
    fontWeight: "bold",
  },
});

export default YouPage;
